import './App.css';
import Login from '../src/components/Login'
import {BrowserRouter, Switch, Route} from 'react-router-dom'
import Registration from '../src/components/registration'

function App() {
  return (
    <div>
      <BrowserRouter>
          <Switch>
            <Route path = '/' component = {Login}></Route>
          </Switch>
      </BrowserRouter>
    </div>
  );
}

export default App;
